import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
        alignItems: "center",
        paddingBottom: 8,
        paddingLeft: 15,
        paddingRight: 15,
        paddingTop: 6
    },
    buttonContainer:{
        flexDirection:"row",
    },
    textFontFamily: {
        fontFamily: "RobotoRegular",
    }
});

export default styles;
